			{
				transitioned = FSM_QualityGate__Sorting_Sorting_Sorting_PukPresent_react(handle,transitioned);
				break;
			}
			case FSM_QualityGate_FSM_QualityGate__Sorting_Sorting_Sorting_Ejecting :
