static void run_cycle(FSM_QualityGate* handle)
{
	/* Performs a 'run to completion' step. */
	if (handle->isExecuting == bool_true)
	{ 
		return;
	} 
	handle->isExecuting = bool_true;
	fSM_QualityGate_dispatch_next_event(handle);
	do
	{ 
		micro_step(handle);
		clear_in_events(handle);
		clear_internal_events(handle);
	} while (fSM_QualityGate_dispatch_next_event(handle) == bool_true);
	handle->isExecuting = bool_false;
}


