static void fsm_qualitygate_eventqueue_init(fsm_qualitygate_eventqueue * eq, fsm_qualitygate_event *buffer, sc_integer capacity)
{
	eq->events = buffer;
	eq->capacity = capacity;
	eq->push_index = 0;
	eq->pop_index = 0;
	eq->size = 0;
}

static sc_integer fsm_qualitygate_eventqueue_size(fsm_qualitygate_eventqueue * eq)
{
	return eq->size;
}

static fsm_qualitygate_event fsm_qualitygate_eventqueue_pop(fsm_qualitygate_eventqueue * eq)
{
	fsm_qualitygate_event event;
	if(fsm_qualitygate_eventqueue_size(eq) <= 0) {
		fsm_qualitygate_event_init(&event, FSM_QualityGate_invalid_event);
	}
	else {
		event = eq->events[eq->pop_index];
		
		if(eq->pop_index < eq->capacity - 1) {
			eq->pop_index++;
		} 
		else {
			eq->pop_index = 0;
		}
		eq->size--;
	}
	return event;
}
static sc_boolean fsm_qualitygate_eventqueue_push(fsm_qualitygate_eventqueue * eq, fsm_qualitygate_event ev)
{
	if(fsm_qualitygate_eventqueue_size(eq) == eq->capacity) {
		return bool_false;
	}
	else {
		eq->events[eq->push_index] = ev;
		
		if(eq->push_index < eq->capacity - 1) {
			eq->push_index++;
		}
		else {
			eq->push_index = 0;
		}
		eq->size++;
		
		return bool_true;
	}
}
static void fsm_qualitygate_event_init(fsm_qualitygate_event * ev, FSM_QualityGateEventID name)
{
	ev->name = name;
}

static void fSM_QualityGate_add_event_to_queue(fsm_qualitygate_eventqueue * eq, FSM_QualityGateEventID name)
{
	fsm_qualitygate_event event;
	fsm_qualitygate_event_init(&event, name);
	fsm_qualitygate_eventqueue_push(eq, event);
}

