static fsm_qualitygate_event fSM_QualityGate_get_next_event(FSM_QualityGate* handle)
{
	fsm_qualitygate_event next_event;
	fsm_qualitygate_event_init(&next_event, FSM_QualityGate_invalid_event);
	if(fsm_qualitygate_eventqueue_size(&(handle->internal_event_queue)) > 0) {
		next_event = fsm_qualitygate_eventqueue_pop(&(handle->internal_event_queue));
	}
	else if(fsm_qualitygate_eventqueue_size(&(handle->in_event_queue)) > 0) {
		next_event = fsm_qualitygate_eventqueue_pop(&(handle->in_event_queue));
	}
	return next_event;
}

static sc_boolean fSM_QualityGate_dispatch_next_event(FSM_QualityGate* handle)
{
	fsm_qualitygate_event nextEvent;
	nextEvent = fSM_QualityGate_get_next_event(handle);
	return fSM_QualityGate_dispatch_event(handle, &nextEvent);
}
